package basic_java_operations;

public class SwitchOperations {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int month =9;
		
		switch(month) {
		
		case 1:
			System.out.println();
			
		case 2 :
			System.out.println("abc");
		
		case 4 :
			System.out.println("April");
		
		case 5 :
			System.out.println("gfjjf");
			
		default :
		System.out.println("gffhfhfh");
		
		}
	}

}
